function Cars(props) {
    return <li>{props.car}</li>
}

function Garage() {
    let cars = ['audi', 'bmw', 'lamborgini', 'jaguar']
    return (
        <div>
            <h2>My Garage</h2>
            <ul>
                {cars.map(car => {
                    return <Cars car={car} />
                })}
            </ul>
        </div>
    )
}

export default Garage
